import '../index.css';
import { Instagram } from '../Components/Social Media/Instagram';
import { Twitter } from '../Components/Social Media/Twitter';
import { LinkedIn } from '../Components/Social Media/LinkedIn';
import { GitHub } from '../Components/Social Media/GitHub';
import { HorizontalLine } from '../Components/HorizontalLine'

export default function Contact() {
  return (
    <>

      <HorizontalLine />

      <ul className="flex justify-center mt-5 mb-20 space-x-5">
        <li> <Instagram height="10" width="10"/> </li>
        <li> <Twitter height="10" width="10"/> </li>
        <li> <LinkedIn height="10" width="10"/> </li>
        <li> <GitHub height="10" width="10"/></li>
      </ul>
    </>

  );
}
